css:
.git-plus .alert {
  color: #aa8a69;
}
.git-plus .success {
  color: #68a281;
}
.git-plus.overlay {
  width: 600px;
}
.git-plus .info-view {
  overflow: auto;
}
.meta.diff.range.unified {
  color: #5786b8;
}
.meta.diff.header {
  color: #5786b8;
}
.markup.deleted.diff {
  color: #9b4444;
}
.markup.inserted.diff {
  color: #68a281;
}
